package net.whydah.sso.ddd.model.application;

import org.junit.Test;
import org.slf4j.Logger;
import org.slf4j.LoggerFactory;

import static org.junit.Assert.assertFalse;
import static org.junit.Assert.assertTrue;

public class LogoUrlTest {


    private static final Logger log = LoggerFactory.getLogger(LogoUrlTest.class);

    @Test
    public void testIllegalLogoUrl() {

        assertFalse(LogoUrl.isValid("<html>"));
        assertFalse(LogoUrl.isValid("<javascript:"));
        assertFalse(LogoUrl.isValid("<html>"));
        assertFalse(LogoUrl.isValid("alert'%2bconfirm('XXS-PoC1')%2b'&hashContent='%2bprompt('XXS-PoC2')%2b'"));
        assertFalse(LogoUrl.isValid("welcome'%2balert('XXS-PoC1')%2b'&hashContent='%2balert('XXS-PoC2')%2b'"));
        assertFalse(LogoUrl.isValid("alert'%2bconfirm('XXS-PoC1')%2b'"));
        assertFalse(LogoUrl.isValid("welcome'%2balert('XXS-PoC1')%2b'"));
        assertFalse(LogoUrl.isValid("https://whydahdev.cantara.no/sso/action?alert'%2bconfirm('XXS-PoC1')%2b'"));
        assertFalse(LogoUrl.isValid("https://whydahdev.cantara.no/sso/action?welcome'%2balert('XXS-PoC1')%2b'"));

    }

    @Test
    public void testOKLogoUrl() {
        assertTrue(LogoUrl.isValid("https://wiki.cantara.no/download/attachments/38962704/whydah"));
        assertTrue(LogoUrl.isValid(imageurl));

    }

    @Test
    public void testLogoUrlWithDataInUrl() {
        assertTrue(LogoUrl.isValid("https://5.imimg.com/data5/SELLER/Default/2021/8/JZ/YI/DY/43177158/schneider-plc-tm200c16r-500x500.jpg"));
    }


    String imageurl = "data:image/png;base64,";
}